import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState } from "react";
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Modal from 'react-bootstrap/Modal';

export default function GetLatestScores() {

    const backendUrl = 'http://localhost:8081';
    const [status, setStatus] = useState("OK");
    const [textArea, setTextArea] = useState("Tu powinna być zawartość bazy danych, ale jak nie to mi wciąż nie działa");

    var userName = localStorage.getItem('userName');
    var password = localStorage.getItem('password');

    async function getScore() {

        let token = userName + ":" + password;
        var etoken = window.btoa(token);
        var basicAuth = 'Basic ' + etoken;

        // await axios.post(`${backendUrl}/api/v1/getlatestscore/`
        // await axios.post(`${backendUrl}/api/v1/getlatestscore/`,
        await axios.post(`${backendUrl}/getlatestscore/`,
        {}, { headers: { authorization: basicAuth } } )
            .then(response => {
                console.log(response.data);

                let scoresListText = ""

                response.data.forEach((e) => {
                    let lid = e.id;
                    let lusername = e.username;
                    let lhiraganaScore1 = e.hiraganaScore1;
                    let lhiraganaScore2 = e.hiraganaScore2;
                    let lhiraganaScore3 = e.hiraganaScore3;
                    let lkatakanaScore1 = e.katakanaScore1;
                    let lkatakanaScore2 = e.katakanaScore2;
                    let lkatakanaScore3 = e.katakanaScore3;

                    let firstPartText = lusername.substring(0, ("ERROR:").length);


                    if (firstPartText !== "ERROR:") {
                        scoresListText += `${lid}, ${lusername}, ${lhiraganaScore1}, ${lhiraganaScore2}, ${lhiraganaScore3}, ${lkatakanaScore1}, ${lkatakanaScore2}, ${lkatakanaScore3}\n`;
                        setTextArea(scoresListText);
                        setStatus("OK");
                    }
                    else {
                        let secondPartText = lusername.substring(("ERROR:").length, lusername.length);
                        scoresListText = lusername + "\n";
                        setTextArea(scoresListText);
                        setStatus(secondPartText);
                    }
                })

            }).catch(err => {

                let myerror = "Błąd połaczenia sieciowego." + err;
                setStatus(myerror);
            });

    }

    const [modalShow, setModalShow] = useState(false);
    const [modalNewUsername, setModalNewUsername] = useState("");
    const [modalNewPassword, setModalNewPassword] = useState("");

    var userName = localStorage.getItem('userName');
    var password = localStorage.getItem('password');

    // async function handleLogin() {
    //     let token = userName + ":" + password;
    //     var etoken = window.btoa(token);
    //     var basicAuth = 'Basic ' + etoken;

    //     await axios.post('http://localhost:8080/login',
    //         {}, { headers: { authorization: basicAuth } }
    //     )
    //     .then(response => {
    //         // Obsługa sukcesu logowania
    //         console.log("Zalogowano pomyślnie!");
    //     })
    //     .catch(error => {
    //         // Obsługa błędu logowania
    //         console.error("Błąd logowania:", error);
    //     });
    // }

    function handleClose(event) {

        let currentButton = event.currentTarget.textContent;

        setModalShow(false);

        if (currentButton === "OK") {

            localStorage.setItem('userName', modalNewUsername);
            localStorage.setItem('password', modalNewPassword);
        }
        else {
            localStorage.setItem('userName', modalNewUsername);
            localStorage.setItem('password', modalNewPassword);
        }
    }

    function handleCloseHeader() {

        setModalShow(false);
        localStorage.setItem('userName', modalNewUsername);
        localStorage.setItem('password', modalNewPassword);
    }

    function handleChangeUser(e) {
        setModalNewUsername(e.target.value)
    }

    function handleChangePassword(e) {
        setModalNewPassword(e.target.value)
    }

    function handleShow() {
        setModalShow(true);
    }

    return (

        <Container>

<p>Aktualnie podany użytkownik i hasło: {userName}, {password}</p>

<Button variant="primary" onClick={handleShow}> Aktualizuj dane do autoryzacji </Button>

<p></p>

<Modal show={modalShow} onHide={handleCloseHeader}>
    <Modal.Header closeButton>
        <Modal.Title>Logowanie</Modal.Title>
    </Modal.Header>
    <Modal.Body>
        <Form>
            <Form.Group className="auto">
                <Form.Label>Użytkownik:</Form.Label>
                <Form.Control type="text" value={modalNewUsername} placeholder="" onChange={(e) => setModalNewUsername(e.target.value)} />
            </Form.Group>
            <Form.Group className="auto">
                <Form.Label>Hasło:</Form.Label>
                <Form.Control type="text" value={modalNewPassword} placeholder="" onChange={(e) => setModalNewPassword(e.target.value)} />
            </Form.Group>
        </Form >

    </Modal.Body>
    <Modal.Footer>
        <Button variant="primary" onClick={handleClose}>
            OK
        </Button>
        <Button variant="secondary" onClick={handleClose}>
            Anuluj
        </Button>
    </Modal.Footer>
</Modal>

            <Button variant="primary" onClick={getScore}>  Odczytaj aktualną listę przelewów  </Button>

            <p></p>

            <Form.Control as="textarea" rows={8} type="text" value={textArea} placeholder="" onChange={(e) => setTextArea(e.target.value)} spellCheck="false" />

            <p></p>

        </Container>

    );

}
